import React from "react";


export default props => {
    let nome = '?'
    let idade = 0
    let nerd = false

    return (
    <div>
        <span> {nome} </span>
        <span> {idade} </span>
        <span> {nerd ? 'Verdadeiro' : 'Falso' } </span>
        <button onClick={
            function (e) {
                props.quandoClicar('João', 53, true)
            }
        }>
            Fornercer informações</button>
    </div>
    )
}
